const EmojiList = () => {
  const emojis = require('emoji.json')

  const renderEmoji = (emojis) => {
    const list = emojis.slice(0, 20).map(emoji => (
      <div key={emoji.codes}>{emoji.char}</div>
    ))
    return list
  }
